### Ethereum Blockchain Messenger Smart Contract

Below is a Solidity smart contract that fulfills the requirements of the blockchain messenger. This contract utilizes the `mapping` data structure to store messages and their respective update counts.

```solidity
pragma solidity ^0.8.0;

contract BlockchainMessenger {
    // Mapping to store messages and their update counts
    mapping(address => mapping(string => uint256)) public messageUpdateCounts;

    // Mapping to store messages
    mapping(address => mapping(string => string)) public messages;

    // Function to save a message on the blockchain
    function saveMessage(string memory _message) public {
        // Increment the update count for the message
        messageUpdateCounts[msg.sender][_message]++;

        // Save the message
        messages[msg.sender][_message] = _message;
    }

    // Function to get the count of updates for a message
    function getMessageUpdateCount(string memory _message) public view returns (uint256) {
        return messageUpdateCounts[msg.sender][_message];
    }

    // Function to get a message
    function getMessage(string memory _message) public view returns (string memory) {
        return messages[msg.sender][_message];
    }
}
```

### Explanation

- **`pragma solidity ^0.8.0;`**: This line specifies the version of the Solidity compiler to use. In this case, it's version 0.8.0.

- **`contract BlockchainMessenger {`**: This line begins the definition of the smart contract named `BlockchainMessenger`.

- **`mapping(address => mapping(string => uint256)) public messageUpdateCounts;`**: This line declares a mapping called `messageUpdateCounts` that stores the update count for each message. The mapping is nested, with the outer key being the address of the message sender, the middle key being the message itself, and the inner value being the update count.

- **`mapping(address => mapping(string => string)) public messages;`**: This line declares another mapping called `messages` that stores the messages themselves. Similar to `messageUpdateCounts`, it's a nested mapping with the outer key being the address of the message sender, the middle key being the message, and the inner value being the message content.

- **`function saveMessage(string memory _message) public {`**: This function allows the contract owner to save a message on the blockchain. It increments the update count for the message and then saves the message itself.

- **`function getMessageUpdateCount(string memory _message) public view returns (uint256) {`**: This function allows anyone to get the update count for a message. It returns the update count for the specified message.

- **`function getMessage(string memory _message) public view returns (string memory) {`**: This function allows anyone to get a message. It returns the content of the specified message.

